#!/usr/bin/perl
my $PrintHelp=qq(
USAGE:
	perl Enrich_analysis <annotation_file> <DEGlist_file> > Result.txt

AUTHOR:
	Xukai Li (xukai_li\@qq.com) 2017/11

DESCRIPTION:
	This perl script Enrich_analysis.pl was written for analyzing 
	differentially expressed gene product annotations in biology. 
	And the statistical test is Fisher\'s exact test. Enrich analysis 
	performed domain aggregation by combining gene expressions 
	before testing for the differentially expressed. 
	Written by Xukai Li and test under the perl enviroment v5.18.2.

DATA STRUCTURES:
The annotation_file data structures of input should as follows:
Bradi5g27700	GO:0005739
Bradi5g27700	GO:0008150
