The DEGlist_file data structures of input should as follows:
Bradi1g01710
Bradi1g02030
Bradi1g02150
Bradi1g02160
Bradi1g02490


EXAMPLE:
	perl  Enrich_analysis.pl  annotation.txt  DEGlist.txt  >  Result.txt
\n);
die($PrintHelp)if(($ARGV[0]=~/-[hH]+/) or (@ARGV != 2));

while(<DATA>){
	$_ =~ s/\n*|\r*//g;
	my @a=split(/\t/,$_);
	$GO_h{$a[0]}= "$a[1]\t$a[2]";
}
open annotation2GENE,$ARGV[0] or die $!;
open DEGLIST,$ARGV[1] or die $!;
while ( <annotation2GENE> ) {
	$_  =~ s/\n*\r*//g;
    next unless /^(\S+)\t(\S+)/;
    $gene2annotations{$1} .= "$2,";
    $gene_annotations{$2}{"genes"} .= "$1,";
    $gene_annotations{$2}{"num"} += 1;
}
while ( <DEGLIST> ) {
	$_  =~ s/\n*\r*//g;
    my $genename = $_;
    $total_deg_num ++;
    if ( $gene2annotations{$genename} ) {
        $deg_own_annotation_num ++;
        my @annotations = split /,/, $gene2annotations{$genename};
        foreach ( @annotations ) {
            $deg_gene_annotations{$_}{"genes"} .= "$genename,";
            $deg_gene_annotations{$_}{"num"} ++;
        }
    }
}
print "$total_deg_num differential expression genes in total, and $deg_own_annotation_num genes own annotation terms.\n";
my @for_enrich_annotations = keys %deg_gene_annotations;
my $annotation_num_for_fisher_test = @for_enrich_annotations;
print "$annotation_num_for_fisher_test annotation terms is perpared for Fisher's exact test.\n";

print "Enrich term\tOntology\tDescription\tNumber in input\tNumber in BG/Ref\tp-value\tGenes\tFDR\n";
foreach my $annotation ( @for_enrich_annotations ) {
    my $npp = keys %gene2annotations;
    my $n1p = $deg_own_annotation_num;
    my $np2 = $gene_annotations{$annotation}{"num"};
    my $n12 = $deg_gene_annotations{$annotation}{"num"};
    my $np1 = $npp - $np2;
    my $n11 = $n1p - $n12;
    my $n21 = $np1 - $n11;
    my $n22 = $np2 - $n12;
    my $genes = $deg_gene_annotations{$annotation}{"genes"};
    my $twotailed_value = calculateStatistic( n11=>$n11,n1p=>$n1p,np1=>$np1,npp=>$npp);
    #print "$annotation\t$GO_h{$annotation}\t$n12\t$n22\t$twotailed_value\t$genes\n" if ($twotailed_value <= 0.05);
    $result{$annotation}  = "$annotation\t$GO_h{$annotation}\t$n12\t$n22\t$twotailed_value\t$genes";
    $result2{$annotation} = $twotailed_value;
}
$hash_size = keys %result;
$i = 0;
foreach $key ( sort { $result2{$a} <=> $result2{$b} } keys %result2){
    $i++;
    $sorted_result{$key} = $i;
}
foreach $key ( sort { $result2{$a} <=> $result2{$b} } keys %result2){
    $FDR = $result2{$key} * $hash_size / $sorted_result{$key};
    $result3{$key} = "$result{$key}\t$FDR\n";
    $result4{$key} = $FDR;
}
foreach $key ( sort { $result4{$a} <=> $result4{$b} } keys %result4){
    #print $result3{$key} if ($result4{$key} <= 0.05);
    print $result3{$key} if ($result4{$key} <= 2);
}





sub calculateStatistic
{
  my %values = @_;
  my $probabilities;
  if( !(&getValues(\%values)) )
  {
    return;
  }
  my $final_limit = ($n1p < $np1) ? $n1p : $np1;
print "";
  my $n11_org = $n11;
  my $n11_start = $n1p + $np1 - $npp;
  if($n11_start<0)
  {
    $n11_start = 0;
  }
  if( !($probabilities = &computeDistribution($n11_start, $final_limit)))
  {
      return;
  }
  my $value;
  my $ttfisher=0;
  foreach $value (sort { $a <=> $b } values %$probabilities)
  {
    if($value > $probabilities->{$n11_org})
    {
      next;
    }
    $ttfisher += exp($value);
  }
  return $ttfisher;
}
sub getValues
{
  my $values = shift;
  if(!(&computeMarginalTotals($values)) ){
    return;
  }
  if( !(&computeObservedValues($values)) ) {
      return;
  }
  return 1;
}
sub computeDistribution
{
  my $n11_start = shift @_;
  my $final_limit = shift @_;
  my @numerator = sort { $b <=> $a } ($n1p, $np1, $n2p, $np2);
  my %probability = ();
  my $i;
  my $j=0;
  my $product = 0;
  $n11 = $n11_start;
  $n12 = $n1p-$n11;
  $n21 = $np1-$n11;
  $n22 = $n2p - $n21;
  while($n22 < 0)
  {
    $n11++;
    $n12 = $n1p - $n11;
    $n21 = $np1 - $n11;
    $n22 = $n2p - $n21;
  }
  my @denominator = ();
  $product = 0;
  my $prob = 0;
  $i = $n11;
  $n12 = $n1p - $i;
  $n21 = $np1 - $i;
  $n22 = $n2p - $n21;
  @denominator = sort { $b <=> $a } ($npp, $n22, $n12, $n21, $i);
  my @dLimits = ();
  my @nLimits = ();
  my $dIndex = 0;
  my $nIndex = 0;
  for ( $j = 0; $j < 4; $j++ )
  {
    if ( $numerator[$j] > $denominator[$j] )
    {
      $nLimits[$nIndex] = $denominator[$j] + 1;
      $nLimits[$nIndex+1] = $numerator[$j];
      $nIndex += 2;
    }
    elsif ( $denominator[$j] > $numerator[$j] )
    {
      $dLimits[$dIndex] = $numerator[$j] + 1;
      $dLimits[$dIndex+1] = $denominator[$j];
      $dIndex += 2;
    }
  }
  $dLimits[$dIndex] = 1;
  $dLimits[$dIndex+1] = $denominator[4];
  $product = computeHyperGeometric(\@dLimits, \@nLimits);
  $probability{$i} = $product;
  $prob = $probability{$i};
  my $subproduct = 0;
  for ($i = $n11+1; $i <= $final_limit; $i++ )
  {
    $subproduct += log $n12;
    $n22++;
    $subproduct -= log $n22;
    $subproduct += log $n21;
    $n12--;
    $n21--;
    $subproduct -= log $i;
    $probability{$i} = $product+$subproduct;
    if($probability{$i} != 0)
    {
      $product = $product+$subproduct;
      $subproduct=0;
    }
  }
  return (\%probability);
}
sub computeMarginalTotals
{
  my ($values)=@_;
  if(!defined $values->{npp})
  {
    $errorMessage = "Total bigram count not passed";
    $errorCodeNumber = 200;
    return;
  }
  elsif($values->{npp}<=0)
  {
    $errorMessage = "Total bigram count cannot be less than to zero";
    $errorCodeNumber = 204;
    return;
  }
  else
  {
    $npp = $values->{npp};
  }
  $n1p=-1;
  if(!defined $values->{n1p})
  {
    $errorMessage = "Required Marginal total (1,p) count not passed";
    $errorCodeNumber = 200;
    return;
  }
  else
  {
    $n1p=$values->{n1p};
  }
  if ($n1p < 0)
  {
    $errorMessage = "Marginal total value 'n1p' must not be negative.";
    $errorCodeNumber = 204;
    return;
  }
  if ($n1p > $npp)
  {
    $errorMessage = "Marginal total value 'n1p' must not exceed total number of bigrams.";
    $errorCodeNumber = 203;
    return;
  }
  $np1 = -1;
  if(!defined $values->{np1})
  {
    $errorMessage = "Required Marginal total (p,1) count not passed";
    $errorCodeNumber = 200;
    return;
  }
  else
  {
    $np1=$values->{np1};
  }
  if ($np1 < 0)
  {
    $errorMessage = "Marginal total value 'np1' must not be negative.";
    $errorCodeNumber = 204;
    return;
  }
  if ($np1 > $npp)
  {
    $errorMessage = "Marginal total value 'np1' must not exceed total number of bigrams.";
    $errorCodeNumber = 203;
    return;
  }
  $np2 = $npp - $np1;
  $n2p = $npp - $n1p;
  return 1;
}
sub computeObservedValues
{
  my ($values) = @_;
  if(!defined $values->{n11})
  {
    $errorMessage = "Required frequency count (1,1) not passed";
    $errorCodeNumber = 200;
    return;
  }
  else
  {
    $n11 = $values->{n11};
  }
  if ($n11 < 0)
  {
    $errorMessage = "Frequency value 'n11' must not be negative.";
    $errorCodeNumber = 201;
    return;
  }
  if($n11 > $npp)
  {
    $errorMessage = "Frequency value 'n11' must not exceed total number of bigrams.";
    $errorCodeNumber = 202;
    return;
  }
  if ($n11 > $np1 || $n11 > $n1p)
  {
    $errorMessage = "Frequency value of ngram 'n11' must not exceed the marginal totals.";
    $errorCodeNumber = 202;
    return;
  }
  $n12 = $n1p - $n11;
  $n21 = $np1 - $n11;
  $n22 = $np2 - $n12;
  if ($n12 < 0)
  {
    $errorMessage = "Frequency value 'n12' must not be negative.";
    $errorCodeNumber = 201;
    return;
  }
  if ($n21 < 0)
  {
    $errorMessage = "Frequency value 'n21' must not be negative.";
    $errorCodeNumber = 201;
    return;
  }
  if ($n22 < 0)
  {
    $errorMessage = "Frequency value 'n22' must not be negative.";
    $errorCodeNumber = 201;
    return;
  }
  return 1;
}
sub computeHyperGeometric
{
  my $dLimits = shift @_;
  my $nLimits = shift @_;
  my $product = 0;
  while ( defined ( $nLimits->[0] ) )
  {
    while ( defined ( $nLimits->[0] ) )
    {
      $product += log $nLimits->[0];
      $nLimits->[0]++;
      if ( $nLimits->[0] > $nLimits->[1] )
      {
        shift @{$nLimits};
        shift @{$nLimits};
      }
    }
    while ( defined ( $dLimits->[0] ) )
    {
      $product -= log $dLimits->[0];
      $dLimits->[0]++;
      if ( $dLimits->[0] > $dLimits->[1] )
      {
        shift @{$dLimits};
        shift @{$dLimits};
      }
    }
  }
  return  $product;
}

